import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <>
      <div className="list-group" >
        <Link
          to="#"
          className="list-group-item list-group-item-action "
          id="list-admin-list" data-bs-toggle="list"
        >
          Admin
        </Link>
        <Link to="exam" className="list-group-item list-group-item-action " aria-current="true"  id="list-exan-list" role="tab">
          Exam
        </Link>
        <Link to="topic" className="list-group-item list-group-item-action" aria-current="true" id="list-topic-list"  role="tab">
          Topic
        </Link>
        <Link to="questions" className="list-group-item list-group-item-action" aria-current="true"  id="list-questions-list"role="tab" >
          Questions
        </Link>
        <Link to="user" className="list-group-item list-group-item-action"   aria-current="true" id="list-user-list"   role="tab">
          Add User
        </Link>
      </div>
    </>
  );
};

export default SideBar;
